import Link from "next/link";

class Listlink extends React.Component {
  constructor(props) {
    super(props);
    this.handleChange.bind(this);
  }

  handleChange = e => {
    this.setState({ IndexState: e.target.value });
  };

  render() {
    return (
      <div className="sideBar border">
        <ul>
          {this.props.list.map((li, i) => (
            <li key={i}>
              <Link href="/education">
                <a value={i} onClick={this.handleChange}>
                  {li}
                </a>
              </Link>
            </li>
          ))}
        </ul>
      </div>
    );
  }
}

export default Listlink;
